package easy;

public class StrStr {
    //找該字串是否在母字串裡面
    //時間花太多
    public static int strStr(String haystack, String needle) {
        if(needle.length()==0)return 0;
        if(haystack.length()<needle.length()){
            return -1;
        };
        int indexN = 0;
        int cursor = 0;
        //i<haystack.length()
        for (int i = 0; i < haystack.length() - needle.length(); i++) {
            if(haystack.length()-i<needle.length()){
                return -1;
            }

            if(haystack.charAt(i)==needle.charAt(cursor)){
                indexN=i;
                while (cursor<needle.length()&&i<haystack.length()){
                    if(needle.charAt(cursor)==haystack.charAt(i)){
                        if (cursor==needle.length()-1){
                            return  indexN;
                        }
                        cursor++;
                        i++;
                    }else{
                        break;
                    }
                }
                cursor=0;
                i=indexN;
            }
        }
        return -1;
    }

    public static int strStr2(String haystack, String needle) {
        if (haystack == null || needle == null || needle.length() == 0) {
            return 0;
        }

        // length of needle can't be greater than haystack's length
        if (needle.length() > haystack.length()) {
            return -1;
        }

        // create a substring that is the same length of needle and then check
        for(int i = 0; i <= haystack.length() - needle.length(); i++) {
            String temp = haystack.substring(i, i + needle.length());
            if (temp.equals(needle)) {
                return i;
            }
        }
        return -1;
    }
    /* 厲害的 */
    public static int strStr3(String haystack, String needle) {
        for (int i = 0; ; i++) {
            for (int j = 0; ; j++) {
                if (j == needle.length()) return i;
                if (i + j == haystack.length()) return -1;
                if (needle.charAt(j) != haystack.charAt(i + j)) break;
            }
        }
    }



    public static void main(String[] args) {
        //"mississippi"
        //"issipi"

        //"mississippi"
        //"pi"
        String haystack = "";
        String needle = "";
        System.out.println(strStr3(haystack,needle));
    }

}
